import { observable, action, makeObservable } from "mobx";
class PhotosStore {
  photos = [];
  setPhotos(photos) {
    this.photos = photos;
  }
}
PhotosStore = makeObservable(PhotosStore, {
  photos: observable,
  setPhotos: action
});
const photosStore = new PhotosStore();
export { photosStore };
